	width: 60%;
	margin: 0 auto;
	display: flex;
	justify-content: space-between;
	font-size: 3rem;
	font-weight: 600;

	h3 {
		font-size: 3rem;
		font-weight: 600;
		&:hover {
			color: #ce5959;
		}
	}
